/*        Note: no FAILED() check is needed after the two calls above. */

/*        Create a 6x6 identity matrix. */

	filld_(&c_b3, &c__36, xident);
	for (i__ = 1; i__ <= 6; ++i__) {
	    xident[(i__1 = i__ + i__ * 6 - 7) < 36 && 0 <= i__1 ? i__1 : 
		    s_rnge("xident", i__1, "zzswfxfm_", (ftnlen)503)] = 1.;
	}
